    "2016-07-16T01:34:06.022299",nt"name": "ideq-air-quality-monitoring-locations",nt"isopen":
    false,nt"url": null,nt"notes": "Locations of DEQ Air monitoring locations
    with Monitoring type and Pollutant. DEQ's monitoring network measures the levels
    of five of the six ambient air criteria pollutants identified by the federal Clean
    Air Act. The criteria pollutants are: Particulate matter (PM10 = particulate matter
    less than or equal to 10 microns in diameter; PM2.5 = particulate matter less than
    or equal to 2.5 microns in diameter) Carbon monoxide Nitrogen dioxide Sulfur dioxide
    Ozone Lead (Airborne lead is no longer considered a major health threat in most
    of the U.S. With the phase-out of leaded gasoline and closure of the Bunker Hill
    Mine, DEQ no longer monitors airborne lead levels.)",nt"license_title": null,nt"extras":
